import numpy as np
import copy
try:
    from pyscf import lib
    einsum = lib.einsum
except ImportError:
    einsum = np.einsum

def ccsd_1_1_energy(cc, T1, T2, S1, U11):
    ''' Calculate CCSD-1-1 energy. 
        Equation generating script using the 'wick' program found in gen_eqns/ccsd_11_amps.py
    '''

    # Fermionic part
    # doubles contrib
    E_ferm = 0.25*einsum('ijab,baji->', cc.I.oovv, T2)
    # t1 contribution
    E_ferm += einsum('ia,ai->', cc.fock_mo.ov, T1)
    # t1**2 contribution
    E_ferm += -0.5*einsum('ijab,bi,aj->', cc.I.oovv, T1, T1)

    # Bosonic and coupling part
    E_bos = einsum('I,I->',cc.G,S1)
    E_bos += einsum('Iia,Iai->', cc.g_mo_blocks.ov, U11)
    E_bos += einsum('Iia,ai,I->', cc.g_mo_blocks.ov, T1, S1)
    #E_bos += einsum('Iai,Iai->',cc.g_mo_blocks.vo, U11)
    #E_bos += einsum('Iai,ai,I->',cc.g_mo_blocks.vo, T1, S1)
    #print('Fermionic correlation energy contribution: {}'.format(E_ferm))
    #print('Bosonic correlation energy contribution: {}'.format(E_bos))

    E = E_ferm + E_bos

    return E

def two_rdm_ferm(cc, write=True):
    ''' Return fermionic sector 2RDM in pyscf (chemist) form, i.e.
        dm2[p,q,r,s] = <p^\dagger r^\dagger s q>
        where p,q,r,s are spin-orbitals. p,q correspond to one particle and r,s
        correspond to another particle.  The contraction between ERIs (in
        Chemist's notation) and rdm2 is E = einsum('pqrs,pqrs', eri, rdm2).

        Note that default ordering of the basis is occ_a, occ_b, virt_a, virt_b, although
        this is a general GHF code.

        NOTES:
        Equations are derived from wick as [i,j,k,l] = <i^+ j^+ k l> for each block.
        This is done *without* taking the connected part, meaning that no 1rdm contribution
        needs to be included later on, as is done with the non-autogen code (from cqcpy).
        These then subsequently have their first two indices transposed
        or a minus sign inserted (note antisymmetry), for agreement with cqcpy
        Finally, the 2RDM is transposed as dm2.transpose(2,0,3,1), for
        consistency with pyscf.
    '''

    if write:
        print('Computing fermionic space 2RDM...')

    if cc.L1 is None:
        if write:
            print('No optimized lambda amplitudes found to compute density matrices.')
            print('Using L = T^+ approximation...')
        cc.init_lam()

    L1 = cc.L1.copy()
    L2 = cc.L2.copy()
    LS1 = cc.LS1.copy()
    LU11 = cc.LU11.copy()

    T1 = cc.T1.copy()
    T2 = cc.T2.copy()
    S1 = cc.S1.copy()
    U11 = cc.U11.copy()

    delta = np.eye(cc.no)

    # oooo block
    dm2_oooo = 1.0*einsum('il,jk->ijkl', delta, delta)
    dm2_oooo += -1.0*einsum('jl,ik->ijkl', delta, delta)
    dm2_oooo += -0.5*einsum('klab,baji->ijkl', L2, T2)
    dm2_oooo += 1.0*einsum('ka,ai,jl->ijkl', L1, T1, delta)
    dm2_oooo += -1.0*einsum('ka,aj,il->ijkl', L1, T1, delta)
    dm2_oooo += -1.0*einsum('la,ai,jk->ijkl', L1, T1, delta)
    dm2_oooo += 1.0*einsum('la,aj,ik->ijkl', L1, T1, delta)
    dm2_oooo += 1.0*einsum('Ika,Iai,jl->ijkl', LU11, U11, delta)
    dm2_oooo += -1.0*einsum('Ika,Iaj,il->ijkl', LU11, U11, delta)
    dm2_oooo += -1.0*einsum('Ila,Iai,jk->ijkl', LU11, U11, delta)
    dm2_oooo += 1.0*einsum('Ila,Iaj,ik->ijkl', LU11, U11, delta)
    dm2_oooo += 1.0*einsum('klab,bi,aj->ijkl', L2, T1, T1)
    dm2_oooo += -0.5*einsum('kmab,baim,jl->ijkl', L2, T2, delta)
    dm2_oooo += 0.5*einsum('kmab,bajm,il->ijkl', L2, T2, delta)
    dm2_oooo += 0.5*einsum('lmab,baim,jk->ijkl', L2, T2, delta)
    dm2_oooo += -0.5*einsum('lmab,bajm,ik->ijkl', L2, T2, delta)
    # Transposed for agreement with cqcpy convention
    dm2_oooo = dm2_oooo.transpose(1,0,2,3)

    # vvvv block
    dm2_vvvv = -0.5*einsum('ijba,cdji->abcd', L2, T2)
    dm2_vvvv += 1.0*einsum('ijba,ci,dj->abcd', L2, T1, T1)
    dm2_vvvv = dm2_vvvv.transpose(1,0,2,3)

    # vovv block
    dm2_vovv = 1.0*einsum('ja,bcij->aibc', L1, T2)
    dm2_vovv += -1.0*einsum('ja,bj,ci->aibc', L1, T1, T1)
    dm2_vovv += 1.0*einsum('ja,cj,bi->aibc', L1, T1, T1)
    dm2_vovv += -1.0*einsum('Ija,bj,Ici->aibc', LU11, T1, U11)
    dm2_vovv += 1.0*einsum('Ija,bi,Icj->aibc', LU11, T1, U11)
    dm2_vovv += 1.0*einsum('Ija,cj,Ibi->aibc', LU11, T1, U11)
    dm2_vovv += -1.0*einsum('Ija,ci,Ibj->aibc', LU11, T1, U11)
    dm2_vovv += 0.5*einsum('jkda,di,bckj->aibc', L2, T1, T2)
    dm2_vovv += -1.0*einsum('jkda,bj,dcik->aibc', L2, T1, T2)
    dm2_vovv += -0.5*einsum('jkda,bi,dckj->aibc', L2, T1, T2)
    dm2_vovv += 1.0*einsum('jkda,cj,dbik->aibc', L2, T1, T2)
    dm2_vovv += 0.5*einsum('jkda,ci,dbkj->aibc', L2, T1, T2)
    dm2_vovv += -1.0*einsum('jkda,bj,ck,di->aibc', L2, T1, T1, T1)
    dm2_vovv = dm2_vovv.transpose(0,1,3,2)

    # vvvo block
    dm2_vvvo = -1.0*einsum('ijba,cj->abci', L2, T1)
    dm2_vvvo = dm2_vvvo.transpose(1,0,2,3)

    # ovoo block
    dm2_ovoo = 1.0*einsum('ja,ik->iajk', L1, delta)
    dm2_ovoo += -1.0*einsum('ka,ij->iajk', L1, delta)
    dm2_ovoo += 1.0*einsum('jkba,bi->iajk', L2, T1)
    dm2_ovoo = dm2_ovoo.transpose(0,1,3,2)

    # oovo block
    dm2_oovo = -1.0*einsum('ai,jk->ijak', T1, delta)
    dm2_oovo += 1.0*einsum('aj,ik->ijak', T1, delta)
    dm2_oovo += 1.0*einsum('kb,baji->ijak', L1, T2)
    dm2_oovo += -1.0*einsum('I,Iai,jk->ijak', LS1, U11, delta)
    dm2_oovo += 1.0*einsum('I,Iaj,ik->ijak', LS1, U11, delta)
    dm2_oovo += -1.0*einsum('kb,bi,aj->ijak', L1, T1, T1)
    dm2_oovo += 1.0*einsum('kb,bj,ai->ijak', L1, T1, T1)
    dm2_oovo += 1.0*einsum('lb,bail,jk->ijak', L1, T2, delta)
    dm2_oovo += -1.0*einsum('lb,bajl,ik->ijak', L1, T2, delta)
    dm2_oovo += -1.0*einsum('Ikb,bi,Iaj->ijak', LU11, T1, U11)
    dm2_oovo += 1.0*einsum('Ikb,bj,Iai->ijak', LU11, T1, U11)
    dm2_oovo += 1.0*einsum('Ikb,ai,Ibj->ijak', LU11, T1, U11)
    dm2_oovo += -1.0*einsum('Ikb,aj,Ibi->ijak', LU11, T1, U11)
    dm2_oovo += -1.0*einsum('klbc,ci,bajl->ijak', L2, T1, T2)
    dm2_oovo += 1.0*einsum('klbc,cj,bail->ijak', L2, T1, T2)
    dm2_oovo += 0.5*einsum('klbc,al,cbji->ijak', L2, T1, T2)
    dm2_oovo += -0.5*einsum('klbc,ai,cbjl->ijak', L2, T1, T2)
    dm2_oovo += 0.5*einsum('klbc,aj,cbil->ijak', L2, T1, T2)
    dm2_oovo += 1.0*einsum('lb,al,bi,jk->ijak', L1, T1, T1, delta)
    dm2_oovo += -1.0*einsum('lb,al,bj,ik->ijak', L1, T1, T1, delta)
    dm2_oovo += 1.0*einsum('Ilb,bi,Ial,jk->ijak', LU11, T1, U11, delta)
    dm2_oovo += -1.0*einsum('Ilb,bj,Ial,ik->ijak', LU11, T1, U11, delta)
    dm2_oovo += 1.0*einsum('Ilb,al,Ibi,jk->ijak', LU11, T1, U11, delta)
    dm2_oovo += -1.0*einsum('Ilb,al,Ibj,ik->ijak', LU11, T1, U11, delta)
    dm2_oovo += -1.0*einsum('klbc,al,ci,bj->ijak', L2, T1, T1, T1)
    dm2_oovo += -0.5*einsum('lmbc,ci,baml,jk->ijak', L2, T1, T2, delta)
    dm2_oovo += 0.5*einsum('lmbc,cj,baml,ik->ijak', L2, T1, T2, delta)
    dm2_oovo += -0.5*einsum('lmbc,al,cbim,jk->ijak', L2, T1, T2, delta)
    dm2_oovo += 0.5*einsum('lmbc,al,cbjm,ik->ijak', L2, T1, T2, delta)
    dm2_oovo = dm2_oovo.transpose(1,0,2,3)
    
    # oovv block
    dm2_oovv = 1.0*einsum('abji->ijab', T2)
    dm2_oovv += -1.0*einsum('ai,bj->ijab', T1, T1)
    dm2_oovv += 1.0*einsum('bi,aj->ijab', T1, T1)
    dm2_oovv += -1.0*einsum('I,ai,Ibj->ijab', LS1, T1, U11)
    dm2_oovv += 1.0*einsum('I,aj,Ibi->ijab', LS1, T1, U11)
    dm2_oovv += 1.0*einsum('I,bi,Iaj->ijab', LS1, T1, U11)
    dm2_oovv += -1.0*einsum('I,bj,Iai->ijab', LS1, T1, U11)
    dm2_oovv += -1.0*einsum('kc,ci,abjk->ijab', L1, T1, T2)
    dm2_oovv += 1.0*einsum('kc,cj,abik->ijab', L1, T1, T2)
    dm2_oovv += -1.0*einsum('kc,ak,cbji->ijab', L1, T1, T2)
    dm2_oovv += 1.0*einsum('kc,ai,cbjk->ijab', L1, T1, T2)
    dm2_oovv += -1.0*einsum('kc,aj,cbik->ijab', L1, T1, T2)
    dm2_oovv += 1.0*einsum('kc,bk,caji->ijab', L1, T1, T2)
    dm2_oovv += -1.0*einsum('kc,bi,cajk->ijab', L1, T1, T2)
    dm2_oovv += 1.0*einsum('kc,bj,caik->ijab', L1, T1, T2)
    dm2_oovv += 1.0*einsum('Ikc,caik,Ibj->ijab', LU11, T2, U11)
    dm2_oovv += -1.0*einsum('Ikc,cajk,Ibi->ijab', LU11, T2, U11)
    dm2_oovv += 1.0*einsum('Ikc,caji,Ibk->ijab', LU11, T2, U11)
    dm2_oovv += -1.0*einsum('Ikc,cbik,Iaj->ijab', LU11, T2, U11)
    dm2_oovv += 1.0*einsum('Ikc,cbjk,Iai->ijab', LU11, T2, U11)
    dm2_oovv += -1.0*einsum('Ikc,cbji,Iak->ijab', LU11, T2, U11)
    dm2_oovv += 1.0*einsum('Ikc,abik,Icj->ijab', LU11, T2, U11)
    dm2_oovv += -1.0*einsum('Ikc,abjk,Ici->ijab', LU11, T2, U11)
    dm2_oovv += -0.5*einsum('klcd,dcik,abjl->ijab', L2, T2, T2)
    dm2_oovv += 0.5*einsum('klcd,dcjk,abil->ijab', L2, T2, T2)
    dm2_oovv += -0.5*einsum('klcd,dalk,cbji->ijab', L2, T2, T2)
    dm2_oovv += 1.0*einsum('klcd,daik,cbjl->ijab', L2, T2, T2)
    dm2_oovv += 0.5*einsum('klcd,dblk,caji->ijab', L2, T2, T2)
    dm2_oovv += -1.0*einsum('klcd,dbik,cajl->ijab', L2, T2, T2)
    dm2_oovv += 0.25*einsum('klcd,ablk,dcji->ijab', L2, T2, T2)
    dm2_oovv += 1.0*einsum('kc,ak,ci,bj->ijab', L1, T1, T1, T1)
    dm2_oovv += -1.0*einsum('kc,ak,cj,bi->ijab', L1, T1, T1, T1)
    dm2_oovv += -1.0*einsum('kc,bk,ci,aj->ijab', L1, T1, T1, T1)
    dm2_oovv += 1.0*einsum('kc,bk,cj,ai->ijab', L1, T1, T1, T1)
    dm2_oovv += -1.0*einsum('Ikc,ci,aj,Ibk->ijab', LU11, T1, T1, U11)
    dm2_oovv += 1.0*einsum('Ikc,ci,bj,Iak->ijab', LU11, T1, T1, U11)
    dm2_oovv += 1.0*einsum('Ikc,cj,ai,Ibk->ijab', LU11, T1, T1, U11)
    dm2_oovv += -1.0*einsum('Ikc,cj,bi,Iak->ijab', LU11, T1, T1, U11)
    dm2_oovv += 1.0*einsum('Ikc,ak,ci,Ibj->ijab', LU11, T1, T1, U11)
    dm2_oovv += -1.0*einsum('Ikc,ak,cj,Ibi->ijab', LU11, T1, T1, U11)
    dm2_oovv += -1.0*einsum('Ikc,ak,bi,Icj->ijab', LU11, T1, T1, U11)
    dm2_oovv += 1.0*einsum('Ikc,ak,bj,Ici->ijab', LU11, T1, T1, U11)
    dm2_oovv += -1.0*einsum('Ikc,bk,ci,Iaj->ijab', LU11, T1, T1, U11)
    dm2_oovv += 1.0*einsum('Ikc,bk,cj,Iai->ijab', LU11, T1, T1, U11)
    dm2_oovv += 1.0*einsum('Ikc,bk,ai,Icj->ijab', LU11, T1, T1, U11)
    dm2_oovv += -1.0*einsum('Ikc,bk,aj,Ici->ijab', LU11, T1, T1, U11)
    dm2_oovv += -0.5*einsum('klcd,di,cj,ablk->ijab', L2, T1, T1, T2)
    dm2_oovv += 0.5*einsum('klcd,di,aj,cblk->ijab', L2, T1, T1, T2)
    dm2_oovv += -0.5*einsum('klcd,di,bj,calk->ijab', L2, T1, T1, T2)
    dm2_oovv += -0.5*einsum('klcd,dj,ai,cblk->ijab', L2, T1, T1, T2)
    dm2_oovv += 0.5*einsum('klcd,dj,bi,calk->ijab', L2, T1, T1, T2)
    dm2_oovv += 1.0*einsum('klcd,ak,di,cbjl->ijab', L2, T1, T1, T2)
    dm2_oovv += -1.0*einsum('klcd,ak,dj,cbil->ijab', L2, T1, T1, T2)
    dm2_oovv += -0.5*einsum('klcd,ak,bl,dcji->ijab', L2, T1, T1, T2)
    dm2_oovv += 0.5*einsum('klcd,ak,bi,dcjl->ijab', L2, T1, T1, T2)
    dm2_oovv += -0.5*einsum('klcd,ak,bj,dcil->ijab', L2, T1, T1, T2)
    dm2_oovv += -1.0*einsum('klcd,bk,di,cajl->ijab', L2, T1, T1, T2)
    dm2_oovv += 1.0*einsum('klcd,bk,dj,cail->ijab', L2, T1, T1, T2)
    dm2_oovv += -0.5*einsum('klcd,bk,ai,dcjl->ijab', L2, T1, T1, T2)
    dm2_oovv += 0.5*einsum('klcd,bk,aj,dcil->ijab', L2, T1, T1, T2)
    dm2_oovv += 1.0*einsum('klcd,ak,bl,di,cj->ijab', L2, T1, T1, T1, T1)
    dm2_oovv = dm2_oovv.transpose(1,0,2,3)

    # vvoo block
    dm2_vvoo = 1.0*einsum('ijba->abij', L2)
    dm2_vvoo = dm2_vvoo.transpose(1,0,2,3)

    # vovo block
    dm2_vovo = 1.0*einsum('ja,bi->aibj', L1, T1)
    dm2_vovo += 1.0*einsum('Ija,Ibi->aibj', LU11, U11)
    dm2_vovo += 1.0*einsum('jkca,cbik->aibj', L2, T2)
    dm2_vovo += -1.0*einsum('ka,bk,ij->aibj', L1, T1, delta)
    dm2_vovo += -1.0*einsum('Ika,Ibk,ij->aibj', LU11, U11, delta)
    dm2_vovo += 1.0*einsum('jkca,bk,ci->aibj', L2, T1, T1)
    dm2_vovo += 0.5*einsum('klca,cblk,ij->aibj', L2, T2, delta)
    dm2_vovo *= -1. # Flip sign
    
    # Now put the blocks together, symmetrizing where appropriate
    # NOTE: We are storing as occupied_a, occupied_b, virtual_a, virtual_b
    dm2 = np.zeros((cc.nso, cc.nso, cc.nso, cc.nso))

    # Antisymmetric wrt switching annihilation operators
    dm2_oooo = (dm2_oooo - dm2_oooo.transpose(0,1,3,2)) / 2.
    dm2_vvvv = (dm2_vvvv - dm2_vvvv.transpose(0,1,3,2)) / 2.
    dm2_vovv = (dm2_vovv - dm2_vovv.transpose(0,1,3,2)) / 2.
    dm2_ovoo = (dm2_ovoo - dm2_ovoo.transpose(0,1,3,2)) / 2.
    dm2_oovv = (dm2_oovv - dm2_oovv.transpose(0,1,3,2)) / 2.
    dm2_vvoo = (dm2_vvoo - dm2_vvoo.transpose(0,1,3,2)) / 2.

    # Antisymmetric wrt switching creation operators
    dm2_vvvo = (dm2_vvvo - dm2_vvvo.transpose(1,0,2,3)) / 2.
    dm2_oooo = (dm2_oooo - dm2_oooo.transpose(1,0,2,3)) / 2.
    dm2_oovo = (dm2_oovo - dm2_oovo.transpose(1,0,2,3)) / 2.
    dm2_oovv = (dm2_oovv - dm2_oovv.transpose(1,0,2,3)) / 2.
    dm2_vvoo = (dm2_vvoo - dm2_vvoo.transpose(1,0,2,3)) / 2.

    # Hermitian wrt inverting of operator order
    dm2[:cc.no, :cc.no, :cc.no, :cc.no] = (dm2_oooo + dm2_oooo.transpose(3,2,1,0)) / 2.
    dm2[cc.no:, cc.no:, cc.no:, cc.no:] = (dm2_vvvv + dm2_vvvv.transpose(3,2,1,0)) / 2.
    
    # ovvv/vovv/vvov/vvvo blocks (two contributions to make sure we have both hermitian parts)
    dm2[:cc.no, cc.no:, cc.no:, cc.no:] = (-dm2_vovv.transpose(1,0,2,3) + dm2_vvvo.transpose(3,2,1,0)) / 2.
    dm2[cc.no:, :cc.no, cc.no:, cc.no:] = (dm2_vovv - dm2_vvvo.transpose(2,3,1,0)) / 2.
    dm2[cc.no:, cc.no:, :cc.no, cc.no:] = (dm2_vovv.transpose(3,2,1,0) - dm2_vvvo.transpose(0,1,3,2)) / 2.
    dm2[cc.no:, cc.no:, cc.no:, :cc.no] = (-dm2_vovv.transpose(3,2,0,1) + dm2_vvvo) / 2.

    # vooo/ovoo/oovo/ooov blocks (two contributions to make sure we have both hermitian parts)
    dm2[cc.no:, :cc.no, :cc.no, :cc.no] = (-dm2_ovoo.transpose(1,0,2,3) - dm2_oovo.transpose(2,3,1,0)) / 2.
    dm2[:cc.no, cc.no:, :cc.no, :cc.no] = (dm2_ovoo + dm2_oovo.transpose(3,2,1,0)) / 2.
    dm2[:cc.no, :cc.no, cc.no:, :cc.no] = (dm2_ovoo.transpose(3,2,1,0) + dm2_oovo) / 2.
    dm2[:cc.no, :cc.no, :cc.no, cc.no:] = (-dm2_ovoo.transpose(3,2,0,1) - dm2_oovo.transpose(0,1,3,2)) / 2.

    # vvoo/oovv blocks
    dm2[cc.no:, cc.no:, :cc.no, :cc.no] = (dm2_vvoo + dm2_oovv.transpose(3,2,1,0)) / 2.
    dm2[:cc.no, :cc.no, cc.no:, cc.no:] = (dm2_oovv + dm2_vvoo.transpose(3,2,1,0)) / 2.

    # voov / ovvo
    dm2[cc.no:, :cc.no, :cc.no, cc.no:] = (-dm2_vovo.transpose(0,1,3,2) - dm2_vovo.transpose(2,3,1,0)) / 2.
    dm2[:cc.no, cc.no:, cc.no:, :cc.no] = (-dm2_vovo.transpose(1,0,2,3) - dm2_vovo.transpose(3,2,0,1)) / 2.

    # vovo / ovov blocks
    dm2[cc.no:, :cc.no, cc.no:, :cc.no] = (dm2_vovo + dm2_vovo.transpose(2,3,0,1)) / 2.
    dm2[:cc.no, cc.no:, :cc.no, cc.no:] = (dm2_vovo.transpose(3,2,1,0) + dm2_vovo.transpose(1,0,3,2)) / 2.

    # Transpose for consistency with pyscf
    dm2 = dm2.transpose(2,0,3,1)
    return dm2

def eb_coup_rdm(cc, write=True, unshifted_bos=True):
    ''' Calculate the e-b coupling RDMs: <b^+_I p^+ q> and <b_I p^+ q>.
        Returns as a tuple (Ipq, Ipq), where the first matrix corresponds
        to the bosonic creation, and the second to the annihilation.

        By default, it will ensure that these two expectation values are the
        h.c. of each other.
        
        Note that if we are shifting the bosonic operators s.t. we remove coupling
        to a single-determinant static density, then we will transform back if
        unshifted_bos=True so that the boson operators are defined wrt the 
        *unshifted* bosons.
    '''

    if write:
        print('Computing electron-boson coupling RDMs...')

    delta = np.eye(cc.no)
    
    L1 = cc.L1.copy()
    L2 = cc.L2.copy()
    LS1 = cc.LS1.copy()
    LU11 = cc.LU11.copy()

    T1 = cc.T1.copy()
    T2 = cc.T2.copy()
    S1 = cc.S1.copy()
    U11 = cc.U11.copy()

    # <b+ o^+ o> block
    dm1_b_oo = 1.0*einsum('I,ij->Iij', LS1, delta)
    dm1_b_oo += -1.0*einsum('Ija,ai->Iij', LU11, T1)
    # <b+ v^+ v> block
    dm1_b_vv = 1.0*einsum('Iia,bi->Iab', LU11, T1)
    # <b+ o^+ v> block
    dm1_b_ov = 1.0*einsum('I,ai->Iia', LS1, T1)
    dm1_b_ov += -1.0*einsum('Ijb,baij->Iia', LU11, T2)
    dm1_b_ov += -1.0*einsum('Ijb,aj,bi->Iia', LU11, T1, T1)
    # <b+ v^+ o> block
    dm1_b_vo = 1.0*einsum('Iia->Iai', LU11)
    # <b o^+ o> block
    dm1_boo = 1.0*einsum('I,ij->Iij', S1, delta)
    dm1_boo += -1.0*einsum('ja,Iai->Iij', L1, U11)
    dm1_boo += -1.0*einsum('ja,ai,I->Iij', L1, T1, S1)
    dm1_boo += 1.0*einsum('ka,Iak,ij->Iij', L1, U11, delta)
    dm1_boo += -1.0*einsum('Jja,I,Jai->Iij', LU11, S1, U11)
    dm1_boo += 1.0*einsum('jkab,bi,Iak->Iij', L2, T1, U11)
    dm1_boo += 0.5*einsum('jkab,baik,I->Iij', L2, T2, S1)
    # <b v^+ v> block
    dm1_bvv = 1.0*einsum('ia,Ibi->Iab', L1, U11)
    dm1_bvv += 1.0*einsum('ia,bi,I->Iab', L1, T1, S1)
    dm1_bvv += 1.0*einsum('Jia,I,Jbi->Iab', LU11, S1, U11)
    dm1_bvv += -1.0*einsum('ijca,bi,Icj->Iab', L2, T1, U11)
    dm1_bvv += -0.5*einsum('ijca,cbji,I->Iab', L2, T2, S1)
    # <b o^+ v> block
    dm1_bov = 1.0*einsum('Iai->Iia', U11)
    dm1_bov += 1.0*einsum('ai,I->Iia', T1, S1)
    dm1_bov += 1.0*einsum('J,I,Jai->Iia', LS1, S1, U11)
    dm1_bov += -1.0*einsum('jb,bi,Iaj->Iia', L1, T1, U11)
    dm1_bov += -1.0*einsum('jb,aj,Ibi->Iia', L1, T1, U11)
    dm1_bov += 1.0*einsum('jb,ai,Ibj->Iia', L1, T1, U11)
    dm1_bov += -1.0*einsum('jb,baij,I->Iia', L1, T2, S1)
    dm1_bov += -1.0*einsum('Jjb,Jbi,Iaj->Iia', LU11, U11, U11)
    dm1_bov += -1.0*einsum('Jjb,Jaj,Ibi->Iia', LU11, U11, U11)
    dm1_bov += 1.0*einsum('Jjb,Jai,Ibj->Iia', LU11, U11, U11)
    dm1_bov += -0.5*einsum('jkbc,cbij,Iak->Iia', L2, T2, U11)
    dm1_bov += -0.5*einsum('jkbc,cakj,Ibi->Iia', L2, T2, U11)
    dm1_bov += 1.0*einsum('jkbc,caij,Ibk->Iia', L2, T2, U11)
    dm1_bov += -1.0*einsum('jb,aj,bi,I->Iia', L1, T1, T1, S1)
    dm1_bov += -1.0*einsum('Jjb,bi,I,Jaj->Iia', LU11, T1, S1, U11)
    dm1_bov += -1.0*einsum('Jjb,aj,I,Jbi->Iia', LU11, T1, S1, U11)
    dm1_bov += 0.5*einsum('jkbc,ci,bakj,I->Iia', L2, T1, T2, S1)
    dm1_bov += 1.0*einsum('jkbc,aj,ci,Ibk->Iia', L2, T1, T1, U11)
    dm1_bov += 0.5*einsum('jkbc,aj,cbik,I->Iia', L2, T1, T2, S1)
    # <b v^+ o> block
    dm1_bvo = 1.0*einsum('ia,I->Iai', L1, S1)
    dm1_bvo += -1.0*einsum('ijba,Ibj->Iai', L2, U11)

    dm_coup_boscre = np.zeros((cc.nbos, cc.nso, cc.nso))
    dm_coup_bosann = np.zeros((cc.nbos, cc.nso, cc.nso))

    dm_coup_boscre[:, :cc.no, :cc.no] = dm1_b_oo
    dm_coup_boscre[:, cc.no:, cc.no:] = dm1_b_vv
    dm_coup_boscre[:, :cc.no, cc.no:] = dm1_b_ov
    dm_coup_boscre[:, cc.no:, :cc.no] = dm1_b_vo
    
    dm_coup_bosann[:, :cc.no, :cc.no] = dm1_boo
    dm_coup_bosann[:, cc.no:, cc.no:] = dm1_bvv
    dm_coup_bosann[:, :cc.no, cc.no:] = dm1_bov
    dm_coup_bosann[:, cc.no:, :cc.no] = dm1_bvo
    #print("%%")
    #print(einsum("npp->np",dm_coup_boscre))
    #print(einsum("npp->np",dm_coup_bosann))

    # Hermitize: This is not enforced automatically in CC theory
    dm_coup_boscre = (dm_coup_boscre + dm_coup_bosann.transpose((0,2,1))) / 2.0
    dm_coup_bosann = dm_coup_boscre.transpose((0,2,1))

    if unshifted_bos and cc.shift:
        if write:
            print('Shifting bosonic RDMs st they are defined wrt the unshifted operators')

        # Since the bosonic operators are shifted by cc.xi, we need to 
        # shift back, and include a fermionic 1RDM contribution.
        rdm_f_1 = one_rdm_ferm(cc, write=False)
        for i in range(dm_coup_boscre.shape[0]):
            dm_coup_boscre[i,:,:] -= 0.5*cc.xi[i]*rdm_f_1[:,:]
            dm_coup_bosann[i,:,:] -= 0.5*cc.xi[i]*rdm_f_1[:,:]

    return (dm_coup_boscre, dm_coup_bosann)

def dm_singbos(cc, write=True):
    ''' Calculate single boson RDMs as a tuple, (<b^+>, <b>) 
        Note that these are *not* shifted back in the case of using shifted boson operators.
    '''

    if write:
        print('Computing single boson RDMs...')
    
    if cc.L1 is None:
        if write:
            print('No optimized lambda amplitudes found to compute density matrices.')
            print('Using L = T^+ approximation...')
        cc.init_lam()
    
    L1 = cc.L1.copy()
    LS1 = cc.LS1.copy()

    S1 = cc.S1.copy()
    U11 = cc.U11.copy()

    dm1_b_cre = LS1.copy()
    dm1_b_ann = S1.copy()
    dm1_b_ann += 1.0*einsum('ia,Iai->I', L1, U11)

    return (dm1_b_cre, dm1_b_ann)

def one_rdm_bos(cc, write=True, unshifted_bos=True):
    ''' Calculate bosonic 1RDM: <b^+_i b_j> 
        Note that we shift the boson operators back to be defined wrt the unshifted boson operators.
    '''

    if write:
        print('Computing bosonic space 1RDM...')
    
    if cc.L1 is None:
        if write:
            print('No optimized lambda amplitudes found to compute density matrices.')
            print('Using L = T^+ approximation...')
        cc.init_lam()

    LS1 = cc.LS1.copy()
    LU11 = cc.LU11.copy()

    S1 = cc.S1.copy()
    U11 = cc.U11.copy()

    dm1_b = 1.0*einsum('I,J->IJ', LS1, S1)
    dm1_b += 1.0*einsum('Iia,Jai->IJ', LU11, U11)

    # Hermitize
    dm1_b = (dm1_b + dm1_b.T) / 2.

    if unshifted_bos and cc.shift:
        if write:
            print('Shifting back bosonic RDM to be defined wrt unshifted boson operator')
        dm1_b_cre, dm1_b_ann = dm_singbos(cc, write=False)
        for i in range(dm1_b.shape[0]):
            dm1_b[i,i] = dm1_b[i,i] - cc.xi[i]*(dm1_b_cre[i] + dm1_b_ann[i]) + cc.xi[i]**2 

    if write:
        print('Trace of bosonic 1RDM: {}'.format(np.trace(dm1_b)))

    return dm1_b

def one_rdm_ferm(cc, make_hermitian=True, write=True):
    ''' Calculate 1RDM '''

    if write:
        print('Computing fermionic space 1RDM...')

    if cc.L1 is None:
        if write:
            print('No optimized lambda amplitudes found to compute density matrices.')
            print('Using L = T^+ approximation...')
        cc.init_lam()

    L1 = cc.L1.copy()
    L2 = cc.L2.copy()
    LS1 = cc.LS1.copy()
    LU11 = cc.LU11.copy()

    T1 = cc.T1.copy()
    T2 = cc.T2.copy()
    S1 = cc.S1.copy()
    U11 = cc.U11.copy()

    dm1_oo = -1.0*einsum('ia,aj->ij', L1, T1)
    dm1_oo += -1.0*einsum('Iia,Iaj->ij', LU11, U11)
    dm1_oo += 0.5*einsum('ikab,bajk->ij', L2, T2)

    dm1_vv = 1.0*einsum('ib,ai->ab', L1, T1)
    dm1_vv += 1.0*einsum('Iib,Iai->ab', LU11, U11)
    dm1_vv += -0.5*einsum('ijcb,caji->ab', L2, T2)

    dm1_ov = L1.copy()

    dm1_vo = T1.copy()
    dm1_vo += 1.0*einsum('I,Iai->ai', LS1, U11)
    dm1_vo += -1.0*einsum('jb,baij->ai', L1, T2)
    dm1_vo += -1.0*einsum('jb,aj,bi->ai', L1, T1, T1)
    dm1_vo += -1.0*einsum('Ijb,bi,Iaj->ai', LU11, T1, U11)
    dm1_vo += -1.0*einsum('Ijb,aj,Ibi->ai', LU11, T1, U11)
    dm1_vo += 0.5*einsum('jkbc,ci,bakj->ai', L2, T1, T2)
    dm1_vo += 0.5*einsum('jkbc,aj,cbik->ai', L2, T1, T2)
    
    dm1 = np.zeros((cc.nso, cc.nso))
    if make_hermitian:
        # Hermitize everything
        dm1[:cc.no, :cc.no] = (dm1_oo + dm1_oo.T) / 2.
        dm1[:cc.no, cc.no:] = (dm1_ov + dm1_vo.T) / 2.
        dm1[cc.no:, :cc.no] = dm1[:cc.no, cc.no:].T
        dm1[cc.no:, cc.no:] = (dm1_vv + dm1_vv.T) / 2.
    else:
        dm1[:cc.no, :cc.no] = dm1_oo
        dm1[:cc.no, cc.no:] = dm1_ov # + dm1_vo.T) / 2.
        dm1[cc.no:, :cc.no] = dm1_vo 
        dm1[cc.no:, cc.no:] = dm1_vv
    
    # Add mean-field part
    dm1[np.diag_indices(cc.no)] += 1.
    if write:
        print('Trace of 1RDM: {}. Number of electrons: {}'.format(np.trace(dm1), cc.no))

    return dm1

def dd_moms_eom(cc, order, include_ref_proj=False, hermit_gs_contrib=False, write=True, pertspace=None):
    ''' Get arbitrary-order moments of the fermionic density-density spectral function.
        mom[p,q,r,s,order] = <c^+_p c_q (H-E)^(order) c^+_r c_s> - \delta_{n0} <c^+_p c_q c^+r c_s>
        Note that the moments from 0 up to order will be computed and returned.
        These moments should be identical to the equivalent EOM spectral moments if
        include_ref_proj=False.

        include_ref_proj will include in the projector the HF reference determinant in the space
            If this is included, then the contribution of the ground state to the zeroth order moment
            needs to be removed, and this can be done with either the hermitized 1RDMs, or the non-
            hermitized 1RDM. This is controlled by 'hermit_gs_contrib'. However, this has the advantage
            that the moments will be exact for 2-electron systems.

        pertspace=None. If given, this should be an array of [nocc+nvir,npert], and will ensure that the
            returned dd-moments are only the ones which span the product fermionic space 
            of these column vectors (where the space of these perturbations is expressed in the canonical
            occ + virt space). The returned dd_moms will be of size [npert, npert, npert, npert, order+1],
            rather then evaluating all possible density moments over the fermionic space, and given in the
            basis defined by these vectors.
        '''
    if write:
        print('Computing fermionic space dd spectral moments up to (and including) order {}'.format(order))
        if pertspace is not None:
            print('Computing dd moments over custom subspace of full fermionic space, of size {}'.format(pertspace.shape[1]))
    if cc.L1 is None:
        if write:
            print('No optimized lambda amplitudes found to compute density matrices.')
            print('Using L = T^+ approximation...')
        cc.init_lam()
    L1 = cc.L1
    L2 = cc.L2
    LS1old = cc.LS1 # Whoops, these got left named as 'old' in the wick script, and I can't be bothered to change
    LU11old = cc.LU11
    T1 = cc.T1
    T2 = cc.T2
    S1 = cc.S1
    U11 = cc.U11
    nocc = T1.shape[1]
    nvir = T1.shape[0]
    ntot = nocc + nvir
    nbos = U11.shape[0]
    delta_v = np.eye(T1.shape[0]) # Virtual-virtual delta
    delta_o = np.eye(T1.shape[1]) # Occupied-occupied delta
    if pertspace is not None:
        npert = pertspace.shape[1]
        assert(npert <= ntot)
        assert(pertspace.shape[0] == ntot)
    else:
        # Computing dd response in the original (full) occupied and virtual space
        npert = ntot
    dd_moms = np.zeros((npert, npert, npert, npert, order+1))

    # Set up the projection of the ket state
    # Note that for these kets, the final two indices are the perturbation indices
    R0_0 = np.zeros((nvir, nocc, ntot, ntot))   # Projection onto singles space
    R0_1 = np.zeros((nvir, nvir, nocc, nocc, ntot, ntot))   # Projection onto doubles space
    R0_2 = np.zeros((nbos, ntot, ntot)) # Projection onto the boson excitation space
    R0_3 = np.zeros((nbos, nvir, nocc, ntot, ntot)) # Projection onto the boson+1p1h excitation space
    if include_ref_proj:
        R0_ref = np.zeros((ntot, ntot)) # Projection onto reference space (if desired)

    # occ-occ contrib
    if include_ref_proj:
        R0_ref[:nocc,:nocc] = delta_o.copy() 
    R0_0[:,:,:nocc,:nocc] += -1.0*einsum('aj,ik->aijk', T1, delta_o)
    R0_1[:,:,:,:,:nocc,:nocc] += -1.0*einsum('baki,jl->abijkl', T2, delta_o)
    R0_1[:,:,:,:,:nocc,:nocc] += 1.0*einsum('bakj,il->abijkl', T2, delta_o)
    R0_3[:,:,:,:nocc,:nocc] += -1.0*einsum('Iaj,ik->Iaijk', U11, delta_o)
    # occ-virt contrib
    if include_ref_proj:
        R0_ref[:nocc, nocc:] = T1.copy().transpose(1,0) 
    R0_0[:,:,:nocc,nocc:] += -T2.copy().transpose(0,3,2,1) # -1.0*einsum('abji->aijb', T2)
    R0_0[:,:,:nocc,nocc:] += -1.0*einsum('bi,aj->aijb', T1, T1)
    R0_1[:,:,:,:,:nocc,nocc:] += -1.0*einsum('ak,bcji->abijkc', T1, T2)
    R0_1[:,:,:,:,:nocc,nocc:] += 1.0*einsum('bk,acji->abijkc', T1, T2)
    R0_1[:,:,:,:,:nocc,nocc:] += 1.0*einsum('ci,bakj->abijkc', T1, T2)
    R0_1[:,:,:,:,:nocc,nocc:] += -1.0*einsum('cj,baki->abijkc', T1, T2)
    R0_2[:,:nocc,nocc:] += U11.copy().transpose(0,2,1)
    R0_3[:,:,:,:nocc,nocc:] += -1.0*einsum('aj,Ibi->Iaijb', T1, U11)
    R0_3[:,:,:,:nocc,nocc:] += -1.0*einsum('bi,Iaj->Iaijb', T1, U11)
    # virt-occ contrib
    R0_0[:,:,nocc:,:nocc] += 1.0*einsum('ij,ab->aibj', delta_o, delta_v)
    # virt-virt contrib
    R0_0[:,:,nocc:,nocc:] += einsum('ci,ab->aibc', T1, delta_v)
    R0_1[:,:,:,:,nocc:,nocc:] += -1.0*einsum('adji,bc->abijcd', T2, delta_v) 
    R0_1[:,:,:,:,nocc:,nocc:] += 1.0*einsum('bdji,ac->abijcd', T2, delta_v)
    R0_3[:,:,:,nocc:,nocc:] += 1.0*einsum('Ici,ab->Iaibc', U11, delta_v)

    if pertspace is not None:
        # If we are specifying a custom perturbation subspace, then these initial vectors need to be rotated
        # into this subspace.
        R0_0_pert = einsum('aixy,xp,yq->aipq', R0_0, pertspace, pertspace)
        R0_1_pert = einsum('abijxy,xp,yq->abijpq', R0_1, pertspace, pertspace)
        R0_2_pert = einsum('Ixy,xp,yq->Ipq', R0_2, pertspace, pertspace)
        R0_3_pert = einsum('Iaixy,xp,yq->Iaipq', R0_3, pertspace, pertspace)
        if include_ref_proj:
            R0_ref_pert = einsum('xy,xp,yq->pq', R0_ref, pertspace, pertspace)
            kets = [(R0_ref_pert, R0_0_pert, R0_1_pert, R0_2_pert, R0_3_pert)]
        else:
            # Only pass in the singles and doubles space to the projector, not the reference state
            # Including this state however doesn't seem to change the excitation energies?
            kets = [(R0_0_pert, R0_1_pert, R0_2_pert, R0_3_pert)]
    else:
        if include_ref_proj:
            kets = [(R0_ref, R0_0, R0_1, R0_2, R0_3)]
        else:
            # Only pass in the singles and doubles space to the projector, not the reference state
            # Including this state however doesn't seem to change the excitation energies?
            kets = [(R0_0, R0_1, R0_2, R0_3)]

    for i in range(order):
        # Apply (H-E) sequentially to each ket. Final index of the R vectors will be considered the list of vectors to apply the operator to.
        kets.append(apply_hbar_dd(cc, kets[-1]))

    # Find the bra states (First indices are operators)
    E_bra_0 = np.zeros((ntot, ntot, nocc, nvir))    # Projection of bra states onto single excitations
    E_bra_1 = np.zeros((ntot, ntot, nocc, nocc, nvir, nvir)) # Projection of bra states onto doubles
    E_bra_2 = np.zeros((ntot, ntot, nbos)) # Projection of bra states onto boson excitation 
    E_bra_3 = np.zeros((ntot, ntot, nbos, nocc, nvir)) # Projection of bra states onto boson+1p1h excit
    if include_ref_proj:
        E_bra_hf = np.zeros((ntot, ntot))   # Optionally, include projection onto reference space

    # occ-occ blocks
    if include_ref_proj:
        E_bra_hf[:nocc, :nocc] = delta_o.copy()
        E_bra_hf[:nocc, :nocc] += -1.0*einsum('ia,aj->ji', L1, T1)
        E_bra_hf[:nocc, :nocc] += -1.0*einsum('Iia,Iaj->ji', LU11old, U11)
        E_bra_hf[:nocc, :nocc] += 0.5*einsum('ijab,bakj->ki', L2, T2)
    E_bra_0[:nocc,:nocc,:,:] += -1.0*einsum('ia,jk->jika', L1, delta_o)
    E_bra_0[:nocc,:nocc,:,:] += 1.0*einsum('ia,jk->jkia', L1, delta_o)
    E_bra_0[:nocc,:nocc,:,:] += 1.0*einsum('ijab,bk->kija', L2, T1)
    E_bra_1[:nocc,:nocc,:,:,:,:] += -1.0*einsum('ijab,kl->kijlba', L2, delta_o)
    E_bra_1[:nocc,:nocc,:,:,:,:] += 1.0*einsum('ijab,kl->kiljba', L2, delta_o)
    E_bra_1[:nocc,:nocc,:,:,:,:] += 1.0*einsum('ijab,kl->kljiba', L2, delta_o)
    E_bra_2[:nocc,:nocc,:] += 1.0*einsum('I,ij->ijI', LS1old, delta_o)
    E_bra_2[:nocc,:nocc,:] += -1.0*einsum('Iia,aj->jiI', LU11old, T1)
    E_bra_3[:nocc,:nocc,:,:,:] += -1.0*einsum('Iia,jk->jiIka', LU11old, delta_o)
    E_bra_3[:nocc,:nocc,:,:,:] += 1.0*einsum('Iia,jk->jkIia', LU11old, delta_o)
    # occ-vir blocks
    if include_ref_proj:
        E_bra_hf[:nocc,nocc:] = T1.copy().transpose(1,0)
        E_bra_hf[:nocc,nocc:] += 1.0*einsum('I,Iai->ia', LS1old, U11)
        E_bra_hf[:nocc,nocc:] += -1.0*einsum('ia,abji->jb', L1, T2)
        E_bra_hf[:nocc,nocc:] += -1.0*einsum('ia,bi,aj->jb', L1, T1, T1)
        E_bra_hf[:nocc,nocc:] += -1.0*einsum('Iia,aj,Ibi->jb', LU11old, T1, U11)
        E_bra_hf[:nocc,nocc:] += -1.0*einsum('Iia,bi,Iaj->jb', LU11old, T1, U11)
        E_bra_hf[:nocc,nocc:] += 0.5*einsum('ijab,bk,acji->kc', L2, T1, T2)
        E_bra_hf[:nocc,nocc:] += 0.5*einsum('ijab,ci,bakj->kc', L2, T1, T2)       
    E_bra_0[:nocc,nocc:,:,:] += 1.0*einsum('ab,ij->iajb', delta_v, delta_o)
    E_bra_0[:nocc,nocc:,:,:] += 1.0*einsum('ia,bj->jbia', L1, T1)
    E_bra_0[:nocc,nocc:,:,:] += 1.0*einsum('Iia,Ibj->jbia', LU11old, U11)
    E_bra_0[:nocc,nocc:,:,:] += 1.0*einsum('ijab,bcki->kcja', L2, T2)
    E_bra_0[:nocc,nocc:,:,:] += -1.0*einsum('ia,bi,jk->jbka', L1, T1, delta_o)
    E_bra_0[:nocc,nocc:,:,:] += -1.0*einsum('ia,aj,bc->jbic', L1, T1, delta_v)
    E_bra_0[:nocc,nocc:,:,:] += -1.0*einsum('Iia,Ibi,jk->jbka', LU11old, U11, delta_o)
    E_bra_0[:nocc,nocc:,:,:] += -1.0*einsum('Iia,Iaj,bc->jbic', LU11old, U11, delta_v)
    E_bra_0[:nocc,nocc:,:,:] += 1.0*einsum('ijab,ci,bk->kcja', L2, T1, T1)
    E_bra_0[:nocc,nocc:,:,:] += -0.5*einsum('ijab,bcji,kl->kcla', L2, T2, delta_o)
    E_bra_0[:nocc,nocc:,:,:] += -0.5*einsum('ijab,baki,cd->kcjd', L2, T2, delta_v)
    E_bra_1[:nocc,nocc:,:,:,:,:] += 1.0*einsum('ijab,ck->kcjiba', L2, T1)
    E_bra_1[:nocc,nocc:,:,:,:,:] += 1.0*einsum('ia,bc,jk->jbikac', L1, delta_v, delta_o)
    E_bra_1[:nocc,nocc:,:,:,:,:] += -1.0*einsum('ia,jk,bc->jbikca', L1, delta_o, delta_v)
    E_bra_1[:nocc,nocc:,:,:,:,:] += -1.0*einsum('ia,bc,jk->jbkiac', L1, delta_v, delta_o)
    E_bra_1[:nocc,nocc:,:,:,:,:] += 1.0*einsum('ia,jk,bc->jbkica', L1, delta_o, delta_v)
    E_bra_1[:nocc,nocc:,:,:,:,:] += -1.0*einsum('ijab,ci,kl->kcjlba', L2, T1, delta_o)
    E_bra_1[:nocc,nocc:,:,:,:,:] += 1.0*einsum('ijab,ci,kl->kcljba', L2, T1, delta_o)
    E_bra_1[:nocc,nocc:,:,:,:,:] += 1.0*einsum('ijab,bk,cd->kcjiad', L2, T1, delta_v)
    E_bra_1[:nocc,nocc:,:,:,:,:] += -1.0*einsum('ijab,bk,cd->kcjida', L2, T1, delta_v)
    E_bra_2[:nocc,nocc:,:] += 1.0*einsum('I,ai->iaI', LS1old, T1)
    E_bra_2[:nocc,nocc:,:] += -1.0*einsum('Iia,abji->jbI', LU11old, T2)
    E_bra_2[:nocc,nocc:,:] += -1.0*einsum('Iia,bi,aj->jbI', LU11old, T1, T1)
    E_bra_3[:nocc,nocc:,:,:,:] += 1.0*einsum('Iia,bj->jbIia', LU11old, T1)
    E_bra_3[:nocc,nocc:,:,:,:] += 1.0*einsum('I,ab,ij->iaIjb', LS1old, delta_v, delta_o)
    E_bra_3[:nocc,nocc:,:,:,:] += -1.0*einsum('Iia,bi,jk->jbIka', LU11old, T1, delta_o)
    E_bra_3[:nocc,nocc:,:,:,:] += -1.0*einsum('Iia,aj,bc->jbIic', LU11old, T1, delta_v)
    # vir-occ blocks
    if include_ref_proj:
        E_bra_hf[nocc:, :nocc] = L1.copy().transpose(1,0)
    E_bra_0[nocc:,:nocc,:,:] += -1.0*L2.copy().transpose(3,0,1,2) # -1.0*einsum('ijab->bija', L2)
    E_bra_2[nocc:,:nocc,:] += 1.0*einsum('Iia->aiI', LU11old)
    # vir-vir blocks
    if include_ref_proj:
        E_bra_hf[nocc:, nocc:] += 1.0*einsum('ia,bi->ab', L1, T1)
        E_bra_hf[nocc:, nocc:] += 1.0*einsum('Iia,Ibi->ab', LU11old, U11)
        E_bra_hf[nocc:, nocc:] += -0.5*einsum('ijab,acji->bc', L2, T2)
    E_bra_0[nocc:,nocc:,:,:] += 1.0*einsum('ia,bc->abic', L1, delta_v)
    E_bra_0[nocc:,nocc:,:,:] += -1.0*einsum('ijab,ci->bcja', L2, T1)
    E_bra_1[nocc:,nocc:,:,:,:,:] += -1.0*einsum('ijab,cd->bcjiad', L2, delta_v)
    E_bra_1[nocc:,nocc:,:,:,:,:] += 1.0*einsum('ijab,cd->bcjida', L2, delta_v)
    E_bra_2[nocc:,nocc:,:] += 1.0*einsum('Iia,bi->abI', LU11old, T1)
    E_bra_3[nocc:,nocc:,:,:,:] += 1.0*einsum('Iia,bc->abIic', LU11old, delta_v)
    
    if pertspace is not None:
        # If we are specifying a custom perturbation subspace, then these bra perturbed states need to be rotated
        # into this subspace
        E_bra_0_pert = einsum('xyia,xp,yq,pqia', E_bra_0, pertspace, pertspace)
        E_bra_1_pert = einsum('xyijab,xp,yq->pqijab', E_bra_1, pertspace, pertspace)
        E_bra_2_pert = einsum('xyI,xp,yq->pqI', E_bra_2, pertspace, pertspace)
        E_bra_3_pert = einsum('xyIia,xp,yq->pqIia', E_bra_3, pertspace, pertspace)
        if include_ref_proj:
            E_bra_hf_pert = einsum('xy,xp,yq->pq', E_bra_hf, pertspace, pertspace)
    else:
        E_bra_0_pert = E_bra_0
        E_bra_1_pert = E_bra_1
        E_bra_2_pert = E_bra_2
        E_bra_3_pert = E_bra_3
        if include_ref_proj:
            E_bra_hf_pert = E_bra_hf

    # Now, dot product together every set of states in kets list with the bra states of E_bra
    for i in range(order+1):
        if include_ref_proj:
            # Include contributions from the reference projector
            # This will ensure that all moments are exact for 2e systems
            # There is still a contribution to the 2RDM from a triples projector for >2e systems, so this will not be exactly right (for ov bra blocks)
            dd_moms[:,:,:,:,i] += einsum('pq,rs->pqrs', E_bra_hf_pert, kets[i][0])
            # Singles
            dd_moms[:,:,:,:,i] += einsum('pqia,airs->pqrs', E_bra_0_pert, kets[i][1])
            # Doubles
            dd_moms[:,:,:,:,i] += 0.25*einsum('pqijab,abijrs->pqrs', E_bra_1_pert, kets[i][2])
            # Bosons
            dd_moms[:,:,:,:,i] += einsum('pqI,Irs->pqrs', E_bra_2_pert, kets[i][3])
            # Bosons + 1p1h
            dd_moms[:,:,:,:,i] += einsum('pqIia,Iairs->pqrs', E_bra_3_pert, kets[i][4])
        else:
            # No reference projector term
            dd_moms[:,:,:,:,i] += einsum('pqia,airs->pqrs', E_bra_0_pert, kets[i][0])
            dd_moms[:,:,:,:,i] += 0.25*einsum('pqijab,abijrs->pqrs', E_bra_1_pert, kets[i][1])
            dd_moms[:,:,:,:,i] += einsum('pqI,Irs->pqrs', E_bra_2_pert, kets[i][2])
            # Bosons + 1p1h
            # TODO: Does this want any double-counting factor?
            dd_moms[:,:,:,:,i] += einsum('pqIia,Iairs->pqrs', E_bra_3_pert, kets[i][3])

    if include_ref_proj:
        # If we are including the reference state in the projector for the excitations definition, then
        # we need to remove the ground state contribution. We can approximate this as the product of 1RDMs
        # This can be done either as the product of hermitian, or non-hermitian RDMs (and hermitised after),
        # which is slightly different.
        # TODO: Do we need to think about the appropriate way to rigorously remove the GS contribution from higher-order moments?
        rdm1 = one_rdm_ferm(cc, write=False, make_hermitian=hermit_gs_contrib)
        if pertspace is not None:
            # Rotate RDM into perturbation space
            rdm_pert = einsum('xy,xp,yq->pq', rdm1, pertspace, pertspace)
        else:
            rdm_pert = rdm1
        dd_moms[:,:,:,:,0] -= einsum('pq,rs->pqrs', rdm_pert, rdm_pert) 

    # Hermitize all moments
    for i in range(order+1):
        dd_moms[:,:,:,:,i] = 0.5*(dd_moms[:,:,:,:,i] + dd_moms[:,:,:,:,i].transpose(3,2,1,0))

    return dd_moms

def apply_hbar_dd(cc, R):
    ''' Apply the N-electron effective hamiltonian in the space of 1h1p+2h2p+b+b1h1p to a trial state.
    R is a tuple of 1h1p, 2h2p2m 1b, 1b1h1p states, with the final index being an index of the vectors
    to apply the state to.
    Optionally, a projector to the reference state is also included.'''

    if len(R) == 4:
        # Assume that we have the projection without the reference state 
        R1 = R[0]
        R2 = R[1]
        R3 = R[2]
        R4 = R[3]
        include_ref_proj = False
    elif len(R) == 5:
        # Assume that we also have the projection onto a reference state
        R0 = R[0]
        R1 = R[1]
        R2 = R[2]
        R3 = R[3]
        R4 = R[4]
        assert(R0.shape[-1] == R2.shape[-1])
        include_ref_proj = True
    assert(R1.shape[-1] == R2.shape[-1])
    L1 = cc.L1
    L2 = cc.L2
    LS1old = cc.LS1 # Whoops, these got left named as 'old' in the wick script, and I can't be bothered to change
    LU11old = cc.LU11
    T1 = cc.T1
    T2 = cc.T2
    S1 = cc.S1
    U11 = cc.U11

    F = cc.fock_mo
    I = cc.I

    g = copy.copy(cc.g_mo_blocks)
    G = cc.G.copy()
    # Note that g is the bosonic annihilation term. The creator tensor is the transpose of it.
    # Explicitly make this, as these are different contractions.
    g_boscre = copy.copy(g)
    g_boscre.vo = cc.g_mo_blocks.ov.copy().transpose((0,2,1))
    g_boscre.ov = cc.g_mo_blocks.vo.copy().transpose((0,2,1))
    g_boscre.oo = cc.g_mo_blocks.oo.copy().transpose((0,2,1))
    g_boscre.vv = cc.g_mo_blocks.vv.copy().transpose((0,2,1))

    w = np.diag(cc.omega).copy()
    # Delta contributions in occupied block due to unlinked contributions.
    delta = np.eye(T1.shape[1]) # Occ x Occ

    if include_ref_proj:
        # Include the projection onto the reference state
        S_ref = 1.0*einsum('I,Ipq->pq', G, R3)
        S_ref += 1.0*einsum('ia,aipq->pq', F.ov, R1)
        S_ref += 1.0*einsum('Iia,Iaipq->pq', g.ov, R4)
        S_ref += 0.25*einsum('ijab,bajipq->pq', I.oovv, R2)
        S_ref += 1.0*einsum('Iia,I,aipq->pq', g.ov, S1, R1)
        S_ref += 1.0*einsum('Iia,ai,Ipq->pq', g.ov, T1, R3)
        S_ref += -1.0*einsum('ijab,bi,ajpq->pq', I.oovv, T1, R1)

    S_0 = 1.0*einsum('I,Iaipq->aipq', G, R4)
    S_0 += -1.0*einsum('ji,ajpq->aipq', F.oo, R1)
    S_0 += 1.0*einsum('ab,bipq->aipq', F.vv, R1)
    S_0 += 1.0*einsum('Iai,Ipq->aipq', g.vo, R3)
    S_0 += -1.0*einsum('jb,abjipq->aipq', F.ov, R2)
    S_0 += -1.0*einsum('Iji,Iajpq->aipq', g.oo, R4)
    S_0 += 1.0*einsum('Iab,Ibipq->aipq', g.vv, R4)
    S_0 += -1.0*einsum('jaib,bjpq->aipq', I.ovov, R1)
    S_0 += 0.5*einsum('jkib,abkjpq->aipq', I.ooov, R2)
    S_0 += -0.5*einsum('jabc,cbjipq->aipq', I.ovvv, R2)
    S_0 += -1.0*einsum('jb,aj,bipq->aipq', F.ov, T1, R1)
    S_0 += -1.0*einsum('jb,bi,ajpq->aipq', F.ov, T1, R1)
    S_0 += -1.0*einsum('Iji,I,ajpq->aipq', g.oo, S1, R1)
    S_0 += -1.0*einsum('Iji,aj,Ipq->aipq', g.oo, T1, R3)
    S_0 += 1.0*einsum('Iab,I,bipq->aipq', g.vv, S1, R1)
    S_0 += 1.0*einsum('Iab,bi,Ipq->aipq', g.vv, T1, R3)
    S_0 += -1.0*einsum('Ijb,I,abjipq->aipq', g.ov, S1, R2)
    S_0 += -1.0*einsum('Ijb,aj,Ibipq->aipq', g.ov, T1, R4)
    S_0 += -1.0*einsum('Ijb,bi,Iajpq->aipq', g.ov, T1, R4)
    S_0 += 1.0*einsum('Ijb,bj,Iaipq->aipq', g.ov, T1, R4)
    S_0 += 1.0*einsum('Ijb,Iai,bjpq->aipq', g.ov, U11, R1)
    S_0 += -1.0*einsum('Ijb,Iaj,bipq->aipq', g.ov, U11, R1)
    S_0 += -1.0*einsum('Ijb,Ibi,ajpq->aipq', g.ov, U11, R1)
    S_0 += -1.0*einsum('Ijb,abji,Ipq->aipq', g.ov, T2, R3)
    S_0 += -1.0*einsum('jkib,aj,bkpq->aipq', I.ooov, T1, R1)
    S_0 += 1.0*einsum('jkib,bj,akpq->aipq', I.ooov, T1, R1)
    S_0 += 1.0*einsum('jabc,ci,bjpq->aipq', I.ovvv, T1, R1)
    S_0 += -1.0*einsum('jabc,cj,bipq->aipq', I.ovvv, T1, R1)
    S_0 += -0.5*einsum('jkbc,aj,cbkipq->aipq', I.oovv, T1, R2)
    S_0 += -0.5*einsum('jkbc,ci,abkjpq->aipq', I.oovv, T1, R2)
    S_0 += 1.0*einsum('jkbc,cj,abkipq->aipq', I.oovv, T1, R2)
    S_0 += 1.0*einsum('jkbc,acji,bkpq->aipq', I.oovv, T2, R1)
    S_0 += 0.5*einsum('jkbc,ackj,bipq->aipq', I.oovv, T2, R1)
    S_0 += 0.5*einsum('jkbc,cbji,akpq->aipq', I.oovv, T2, R1)
    S_0 += -1.0*einsum('Ijb,aj,I,bipq->aipq', g.ov, T1, S1, R1)
    S_0 += -1.0*einsum('Ijb,bi,I,ajpq->aipq', g.ov, T1, S1, R1)
    S_0 += -1.0*einsum('Ijb,bi,aj,Ipq->aipq', g.ov, T1, T1, R3)
    S_0 += -1.0*einsum('jkbc,aj,ck,bipq->aipq', I.oovv, T1, T1, R1)
    S_0 += 1.0*einsum('jkbc,ci,aj,bkpq->aipq', I.oovv, T1, T1, R1)
    S_0 += -1.0*einsum('jkbc,ci,bj,akpq->aipq', I.oovv, T1, T1, R1)

    S_1 = 1.0*einsum('ai,bjpq->abijpq', F.vo, R1)
    S_1 += -1.0*einsum('aj,bipq->abijpq', F.vo, R1)
    S_1 += -1.0*einsum('bi,ajpq->abijpq', F.vo, R1)
    S_1 += 1.0*einsum('bj,aipq->abijpq', F.vo, R1)
    S_1 += 1.0*einsum('ki,bakjpq->abijpq', F.oo, R2)
    S_1 += -1.0*einsum('kj,bakipq->abijpq', F.oo, R2)
    S_1 += 1.0*einsum('ac,bcjipq->abijpq', F.vv, R2)
    S_1 += -1.0*einsum('bc,acjipq->abijpq', F.vv, R2)
    S_1 += 1.0*einsum('Iai,Ibjpq->abijpq', g.vo, R4)
    S_1 += -1.0*einsum('Iaj,Ibipq->abijpq', g.vo, R4)
    S_1 += -1.0*einsum('Ibi,Iajpq->abijpq', g.vo, R4)
    S_1 += 1.0*einsum('Ibj,Iaipq->abijpq', g.vo, R4)
    S_1 += -1.0*einsum('kaji,bkpq->abijpq', I.ovoo, R1)
    S_1 += 1.0*einsum('kbji,akpq->abijpq', I.ovoo, R1)
    S_1 += -1.0*einsum('baic,cjpq->abijpq', I.vvov, R1)
    S_1 += 1.0*einsum('bajc,cipq->abijpq', I.vvov, R1)
    S_1 += -0.5*einsum('klji,balkpq->abijpq', I.oooo, R2)
    S_1 += 1.0*einsum('kaic,bckjpq->abijpq', I.ovov, R2)
    S_1 += -1.0*einsum('kajc,bckipq->abijpq', I.ovov, R2)
    S_1 += -1.0*einsum('kbic,ackjpq->abijpq', I.ovov, R2)
    S_1 += 1.0*einsum('kbjc,ackipq->abijpq', I.ovov, R2)
    S_1 += -0.5*einsum('bacd,dcjipq->abijpq', I.vvvv, R2)
    S_1 += 1.0*einsum('I,Iai,bjpq->abijpq', G, U11, R1)
    S_1 += -1.0*einsum('I,Iaj,bipq->abijpq', G, U11, R1)
    S_1 += -1.0*einsum('I,Ibi,ajpq->abijpq', G, U11, R1)
    S_1 += 1.0*einsum('I,Ibj,aipq->abijpq', G, U11, R1)
    S_1 += -1.0*einsum('ki,ak,bjpq->abijpq', F.oo, T1, R1)
    S_1 += 1.0*einsum('ki,bk,ajpq->abijpq', F.oo, T1, R1)
    S_1 += 1.0*einsum('kj,ak,bipq->abijpq', F.oo, T1, R1)
    S_1 += -1.0*einsum('kj,bk,aipq->abijpq', F.oo, T1, R1)
    S_1 += 1.0*einsum('ac,ci,bjpq->abijpq', F.vv, T1, R1)
    S_1 += -1.0*einsum('ac,cj,bipq->abijpq', F.vv, T1, R1)
    S_1 += -1.0*einsum('bc,ci,ajpq->abijpq', F.vv, T1, R1)
    S_1 += 1.0*einsum('bc,cj,aipq->abijpq', F.vv, T1, R1)
    S_1 += 1.0*einsum('Iai,I,bjpq->abijpq', g.vo, S1, R1)
    S_1 += -1.0*einsum('Iaj,I,bipq->abijpq', g.vo, S1, R1)
    S_1 += -1.0*einsum('Ibi,I,ajpq->abijpq', g.vo, S1, R1)
    S_1 += 1.0*einsum('Ibj,I,aipq->abijpq', g.vo, S1, R1)
    S_1 += -1.0*einsum('kc,ak,bcjipq->abijpq', F.ov, T1, R2)
    S_1 += 1.0*einsum('kc,bk,acjipq->abijpq', F.ov, T1, R2)
    S_1 += 1.0*einsum('kc,ci,bakjpq->abijpq', F.ov, T1, R2)
    S_1 += -1.0*einsum('kc,cj,bakipq->abijpq', F.ov, T1, R2)
    S_1 += 1.0*einsum('kc,acji,bkpq->abijpq', F.ov, T2, R1)
    S_1 += -1.0*einsum('kc,acki,bjpq->abijpq', F.ov, T2, R1)
    S_1 += 1.0*einsum('kc,ackj,bipq->abijpq', F.ov, T2, R1)
    S_1 += -1.0*einsum('kc,baki,cjpq->abijpq', F.ov, T2, R1)
    S_1 += 1.0*einsum('kc,bakj,cipq->abijpq', F.ov, T2, R1)
    S_1 += -1.0*einsum('kc,bcji,akpq->abijpq', F.ov, T2, R1)
    S_1 += 1.0*einsum('kc,bcki,ajpq->abijpq', F.ov, T2, R1)
    S_1 += -1.0*einsum('kc,bckj,aipq->abijpq', F.ov, T2, R1)
    S_1 += 1.0*einsum('Iki,I,bakjpq->abijpq', g.oo, S1, R2)
    S_1 += -1.0*einsum('Iki,ak,Ibjpq->abijpq', g.oo, T1, R4)
    S_1 += 1.0*einsum('Iki,bk,Iajpq->abijpq', g.oo, T1, R4)
    S_1 += 1.0*einsum('Iki,Iaj,bkpq->abijpq', g.oo, U11, R1)
    S_1 += -1.0*einsum('Iki,Iak,bjpq->abijpq', g.oo, U11, R1)
    S_1 += -1.0*einsum('Iki,Ibj,akpq->abijpq', g.oo, U11, R1)
    S_1 += 1.0*einsum('Iki,Ibk,ajpq->abijpq', g.oo, U11, R1)
    S_1 += 1.0*einsum('Iki,bakj,Ipq->abijpq', g.oo, T2, R3)
    S_1 += -1.0*einsum('Ikj,I,bakipq->abijpq', g.oo, S1, R2)
    S_1 += 1.0*einsum('Ikj,ak,Ibipq->abijpq', g.oo, T1, R4)
    S_1 += -1.0*einsum('Ikj,bk,Iaipq->abijpq', g.oo, T1, R4)
    S_1 += -1.0*einsum('Ikj,Iai,bkpq->abijpq', g.oo, U11, R1)
    S_1 += 1.0*einsum('Ikj,Iak,bipq->abijpq', g.oo, U11, R1)
    S_1 += 1.0*einsum('Ikj,Ibi,akpq->abijpq', g.oo, U11, R1)
    S_1 += -1.0*einsum('Ikj,Ibk,aipq->abijpq', g.oo, U11, R1)
    S_1 += -1.0*einsum('Ikj,baki,Ipq->abijpq', g.oo, T2, R3)
    S_1 += 1.0*einsum('Iac,I,bcjipq->abijpq', g.vv, S1, R2)
    S_1 += 1.0*einsum('Iac,ci,Ibjpq->abijpq', g.vv, T1, R4)
    S_1 += -1.0*einsum('Iac,cj,Ibipq->abijpq', g.vv, T1, R4)
    S_1 += -1.0*einsum('Iac,Ibi,cjpq->abijpq', g.vv, U11, R1)
    S_1 += 1.0*einsum('Iac,Ibj,cipq->abijpq', g.vv, U11, R1)
    S_1 += 1.0*einsum('Iac,Ici,bjpq->abijpq', g.vv, U11, R1)
    S_1 += -1.0*einsum('Iac,Icj,bipq->abijpq', g.vv, U11, R1)
    S_1 += 1.0*einsum('Iac,bcji,Ipq->abijpq', g.vv, T2, R3)
