        Lag += 1.0*einsum('Iia,Jab,J,Ibi->', LU11, g.vv, S1, U11)
        Lag += -1.0*einsum('Iia,Ijb,bi,aj->', LU11, g_boscre.ov, T1, T1)
        Lag += -0.5*einsum('ia,jkbc,aj,cbki->', L1, I.oovv, T1, T2)
        Lag += -0.5*einsum('ia,jkbc,ci,abkj->', L1, I.oovv, T1, T2)
        Lag += 1.0*einsum('ia,jkbc,cj,abki->', L1, I.oovv, T1, T2)
        Lag += -1.0*einsum('Iia,Jjb,Iaj,Jbi->', LU11, g.ov, U11, U11)
        Lag += -1.0*einsum('Iia,Jjb,Ibi,Jaj->', LU11, g.ov, U11, U11)
