        Lag += -1.0*einsum('Iia,jkib,aj,Ibk->', LU11, I.ooov, T1, U11)
        Lag += 1.0*einsum('Iia,jkib,bj,Iak->', LU11, I.ooov, T1, U11)
        Lag += 1.0*einsum('Iia,jabc,ci,Ibj->', LU11, I.ovvv, T1, U11)
        Lag += -1.0*einsum('Iia,jabc,cj,Ibi->', LU11, I.ovvv, T1, U11)
        Lag += 0.5*einsum('ijab,kc,bk,acji->', L2, F.ov, T1, T2)
        Lag += 0.5*einsum('ijab,kc,ci,bakj->', L2, F.ov, T1, T2)
        Lag += 1.0*einsum('ijab,Iki,bk,Iaj->', L2, g.oo, T1, U11)
        Lag += 0.5*einsum('ijab,Iki,bakj,I->', L2, g.oo, T2, S1)
        Lag += -1.0*einsum('ijab,Ibc,ci,Iaj->', L2, g.vv, T1, U11)
        Lag += -0.5*einsum('ijab,Ibc,acji,I->', L2, g.vv, T2, S1)
        Lag += 0.25*einsum('ijab,klji,bk,al->', L2, I.oooo, T1, T1)
        Lag += -1.0*einsum('ijab,kbic,cj,ak->', L2, I.ovov, T1, T1)
        Lag += 0.25*einsum('ijab,bacd,di,cj->', L2, I.vvvv, T1, T1)
        Lag += 1.0*einsum('Iia,jkbc,acji,Ibk->', LU11, I.oovv, T2, U11)
        Lag += 0.5*einsum('Iia,jkbc,ackj,Ibi->', LU11, I.oovv, T2, U11)
        Lag += 0.5*einsum('Iia,jkbc,cbji,Iak->', LU11, I.oovv, T2, U11)
        Lag += -0.5*einsum('ijab,Ikc,baki,Icj->', L2, g.ov, T2, U11)
        Lag += -0.5*einsum('ijab,Ikc,bcji,Iak->', L2, g.ov, T2, U11)
        Lag += 1.0*einsum('ijab,Ikc,bcki,Iaj->', L2, g.ov, T2, U11)
        Lag += -1.0*einsum('ijab,klic,bk,aclj->', L2, I.ooov, T1, T2)
        Lag += 0.25*einsum('ijab,klic,cj,balk->', L2, I.ooov, T1, T2)
        Lag += -0.5*einsum('ijab,klic,ck,balj->', L2, I.ooov, T1, T2)
        Lag += -0.25*einsum('ijab,kbcd,ak,dcji->', L2, I.ovvv, T1, T2)
        Lag += 1.0*einsum('ijab,kbcd,di,ackj->', L2, I.ovvv, T1, T2)
        Lag += 0.5*einsum('ijab,kbcd,dk,acji->', L2, I.ovvv, T1, T2)
        Lag += -0.25*einsum('ijab,klcd,baki,dclj->', L2, I.oovv, T2, T2)
        Lag += -0.25*einsum('ijab,klcd,bdji,aclk->', L2, I.oovv, T2, T2)
        Lag += 0.5*einsum('ijab,klcd,bdki,aclj->', L2, I.oovv, T2, T2)
        Lag += 0.0625*einsum('ijab,klcd,dcji,balk->', L2, I.oovv, T2, T2)
        Lag += -1.0*einsum('ia,Ijb,bi,aj,I->', L1, g.ov, T1, T1, S1)
        Lag += 1.0*einsum('ia,jkbc,ci,aj,bk->', L1, I.oovv, T1, T1, T1)
        Lag += -1.0*einsum('Iia,Jjb,aj,J,Ibi->', LU11, g.ov, T1, S1, U11)
        Lag += -1.0*einsum('Iia,Jjb,bi,J,Iaj->', LU11, g.ov, T1, S1, U11)
        Lag += -1.0*einsum('Iia,jkbc,aj,ck,Ibi->', LU11, I.oovv, T1, T1, U11)
        Lag += 1.0*einsum('Iia,jkbc,ci,aj,Ibk->', LU11, I.oovv, T1, T1, U11)
        Lag += -1.0*einsum('Iia,jkbc,ci,bj,Iak->', LU11, I.oovv, T1, T1, U11)
        Lag += 0.5*einsum('ijab,Ikc,bk,acji,I->', L2, g.ov, T1, T2, S1)
        Lag += 1.0*einsum('ijab,Ikc,ci,bk,Iaj->', L2, g.ov, T1, T1, U11)
        Lag += 0.5*einsum('ijab,Ikc,ci,bakj,I->', L2, g.ov, T1, T2, S1)
        Lag += -0.5*einsum('ijab,klic,cj,bk,al->', L2, I.ooov, T1, T1, T1)
        Lag += 0.5*einsum('ijab,kbcd,di,cj,ak->', L2, I.ovvv, T1, T1, T1)
        Lag += -0.125*einsum('ijab,klcd,bk,al,dcji->', L2, I.oovv, T1, T1, T2)
