        Lag += -0.0625*einsum('ijab,abji->', L2, I.vvoo)
        Lag += -0.0625*einsum('ijab,baij->', L2, I.vvoo)
        Lag += 0.0625*einsum('ijab,baji->', L2, I.vvoo)
        Lag += 1.0*einsum('I,IJ,J->', LS1, w, S1)
        Lag += 1.0*einsum('I,ia,Iai->', LS1, F.ov, U11)
        Lag += 1.0*einsum('I,Iia,ai->', LS1, g_boscre.ov, T1)
