        Lag += 0.125*einsum('ijab,bj,ai->', I.oovv, T1, T1)
        Lag += 0.25*einsum('ijab,ai,bj->', L2, F.vo, T1)
        Lag += -0.25*einsum('ijab,aj,bi->', L2, F.vo, T1)
